import axios from 'axios'

export default class services {
    constructor() {
        this.service = axios.create({
            baseURL: 'http://localhost:5000/api',
            withCredentials: true
        })
    }


    getCart = userId => {
        console.log(userId)
        return this.service.get(`cart/oneCart/${userId}`)
    }

}
